425	Submodelo_Avaluos_V1_1.AV_TipificacionConstruccionTipo	\N	0	Residencial_1_Bajo_Bajo	\N	f	Residencial 1 – (Bajo-Bajo)	Las viviendas que pertenecen a este grupo están construidas sin planeación alguna y generalmente con materiales de desecho tanto en las paredes como en los techos, construido o acondicionado para alojamiento, aunque no reúna las condiciones sanitarias indispensables. Generalmente carecen de algún servicio público básico y/o están ubicadas en zonas marginales no urbanizadas ni urbanizables, siendo de invasión y con escasez de vías de comunicación y transporte urbano.
426	Submodelo_Avaluos_V1_1.AV_TipificacionConstruccionTipo	\N	1	Residencial_2_Bajo	\N	f	Residencial 2 – (Bajo)	Las viviendas que pertenecen a este grupo están construidas con o sin planeación y generalmente con materiales como madera, prefabricado, ladrillo o bloque, cubiertas en zinc o teja de barro y con acabados sencillos, pueden disponer de algunos servicios públicos básicos, están situados por lo general en la periferia y disponen de algunas vías públicas sin pavimentar y escasos medios de transporte.
427	Submodelo_Avaluos_V1_1.AV_TipificacionConstruccionTipo	\N	2	Residencial_3_Medio_Bajo	\N	f	Residencial 3 – (Medio-Bajo)	Las viviendas que pertenecen a este grupo generalmente están constituidas por edificaciones técnicamente planeadas, con fachadas calificadas como regular, con muros de ladrillo o bloque, cubiertas de placa de concreto o teja en asbesto cemento. Generalmente cuentan con servicios públicos básicos, poseen vías de comunicación pavimentadas y medio de transporte urbano.
