442	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ProcedimientoCatastralRegistralTipo	\N	0	Actualizacion_Linderos	\N	f	Actualización linderos con efectos registrales	El gestor catastral competente, de oficio o a solicitud de parte del titular del derecho de dominio, o de las entidades públicas que con ocasión de sus funciones legales administran inmuebles propios o ajenos, podrán efectuar la actualización mediante la descripción técnica de linderos de bienes inmuebles, cuando sean verificables mediante métodos directos y/o indirectos sin variación, o cuando la variación o diferencia se encuentre dentro de los márgenes de tolerancia establecidos por la máxima autoridad catastral. La descripción de los linderos llevará a la certeza del área. Articulo 2.2.2.2.17. Decreto 148 de 2020.
443	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ProcedimientoCatastralRegistralTipo	\N	1	Rectificacion_Area	\N	f	Rectificación de área por imprecisa determinación con efectos registrales	La rectificación de área en el sistema catastral y/o registral procederá ante el gestor catastral, de oficio o a solicitud de parte del titular  del derecho de dominio, o de las entidades públicas que con ocasión de sus funciones legales administran inmuebles propios o ajenos, cuando los linderos estén debida y técnicamente descritos, sean verificables mediante métodos directos y/o indirectos sin variación, pero que a lo largo de la tradición del bien inmueble el área de éste no haya sido determinada adecuadamente, o cuando la variación o diferencia se encuentre dentro de los márgenes de tolerancia establecidos por la máxima autoridad catastral. Artículo 2.2.2.2.17. Decreto 148 de 2020.
444	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ProcedimientoCatastralRegistralTipo	\N	2	Rectificacion_Linderos	\N	f	Rectificación de linderos por acuerdo entre las partes con efectos registrales	La rectificación de linderos en el sistema catastral y registral procederá de oficio o a solicitud de parte, ante el gestor catastral, siempre y cuando se haya suscrito acta de colindancia con pleno acuerdo entre los propietarios que compartan uno o varios linderos, pero se adviertan diferencias de linderos y áreas, entre la verificación mediante métodos directos y/o indirectos y la información del folio de matricula inmobiliaria. La rectificación de todos los linderos puede llevar a la certeza del área del inmueble. Artículo 2.2.2.2.17. Decreto 148 de 2020.
445	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ProcedimientoCatastralRegistralTipo	\N	3	Inclusion_Cabida_Linderos	\N	f	Inclusión en el campo de cabida y linderos del dato del área y/o linderos en los folios de matrícula inmobiliaria	n los casos donde los folios de matrícula inmobiliaria no hayan contado con información de área y/o linderos, desde el inicio del ciclo traslaticio del bien\ninmueble que identifican; la Oficina de Registro de Instrumentos Públicos procederá la inclusión del dato de área y/o linderos en las respectivas matrículas inmobiliarias, que se tomará de la base catastral administrada por el gestor catastral competente.
446	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ProcedimientoCatastralRegistralTipo	\N	4	No_Requiere	\N	f	No requiere procedimiento	No requiere procedimiento catastral con efecto registral.
\.


